-- ----------------------------
-- View structure for view_outstanding_order
-- ----------------------------
DROP VIEW IF EXISTS `view_outstanding_order`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `view_outstanding_order` AS SELECT
	sales_order_detail_option AS sod_option,sales_order_detail_item_product_id as sod_product,
	sum(
		sales_order_detail_qty_order
	) AS sod_qty
FROM
	sales_order_detail
LEFT JOIN sales_order ON sales_order.sales_order_id = sales_order_detail.sales_order_detail_sales_order_id
WHERE
	sales_order.sales_order_status in (1,2,3)
GROUP BY
	sales_order_detail_option ;

-- ----------------------------
-- View structure for view_stock
-- ----------------------------
DROP VIEW IF EXISTS `view_stock`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `view_stock` AS SELECT
	IFNULL(
		view_stock_product.id,
		item_product.item_product_id
	) AS item_product_id,
	`item_color_name`,
	`item_product_id` as product_id,
	`item_product_name`,
	`view_stock_product`.*
FROM
	`item_product`
LEFT JOIN `view_stock_product` ON `product` = `item_product_id`
LEFT JOIN `item_color` ON `color` = `item_color_id` ;

-- ----------------------------
-- View structure for view_stock_product
-- ----------------------------
DROP VIEW IF EXISTS `view_stock_product`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `view_stock_product` AS SELECT
	concat(
		`item_stock`.`item_stock_product`,
		ifnull(
			`item_stock`.`item_stock_color`,
			''
		),
		ifnull(
			LOWER(`item_stock`.`item_stock_size`),
			''
		)
	) AS `id`,
	`item_stock`.`item_stock_product` AS `product`,
	`item_stock`.`item_stock_color` AS `color`,
	`item_color`.`item_color_name` AS `hex`,
	`item_stock`.`item_stock_size` AS `size`,
	sum(
		`item_stock`.`item_stock_qty`
	) AS `qty`
FROM
	(
		`item_stock`
		LEFT JOIN `item_color` ON (
			`item_color`.`item_color_id` = `item_stock`.`item_stock_color`
		)
	)
GROUP BY
	`item_stock`.`item_stock_product`,
	`item_stock`.`item_stock_color`,
	`item_stock`.`item_stock_size`
HAVING
	`qty` > 0 ;

-- ----------------------------
-- View structure for view_wishlist
-- ----------------------------
DROP VIEW IF EXISTS `view_wishlist`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `view_wishlist` AS SELECT * from item_product INNER JOIN item_wishlist on item_product.item_product_id=item_wishlist_item_product_id ;
